import { Link } from "react-router-dom";

const Card = (data) => {
  return (
    <div className="recipe-preview" key={data._id}>
      <Link to={`/recipes/${data._id}`}>
        <h2>{data.dish}</h2>
      </Link>
    </div>
  );
};

export default Card;
